God Bless Ozzy Osbourne
God Bless Ozzy Osbourne pulls the curtain open on the man known as the Prince of Darkness. For four decades Ozzy has been a rock icon known as much for his trademark personality and offstage antics as for his music as the frontman of Black Sabbath. With his rise to fame and money and his self-esteem issues, everything eventually took a toll on Ozzy as he embarked on an epic binge that would last 40 years. Directors Mike Fleiss and Mike Piscitelli spent two years on the road with Ozzy. Live footage from his latest tour is threaded throughout, but it's Ozzy's reflections and surprising candor about himself that make up the heart of the film. Frank interviews with his family-including Kelly, Jack (also a producer of the film), and wife Sharon, who we saw on the popular television series The Osbournes, as well as his other children and siblings-don't always paint a pretty picture. But Ozzy readily admits that his crazy life, marked by decades-long battles against addiction, affected his role as a husband and father. His life and career have had their ups and downs, and this definitive bio-doc is a testament to his survival.


